import { data } from "./Data/TodoListData"


function Task() {

    return (
        <>
            {data.map(task => (
                <div key={task.id}>
                    <h1>{task.description.title}</h1>
                    <span>description:
                        <p>{task.description.content}</p>
                    </span>
                    <div className="prosess">
                        <span>
                            {(task.process.status) && (<p>Completed</p>)}
                        </span>
                        <p> Thời gian đã thực hiện: {task.process.actual_duration}h </p>
                        <div> Due:
                            <p> <span>{task.date.hour}:{task.date.minute}</span> - {task.date.day}/{task.date.month}/{task.date.year}</p>
                        </div>
                    </div>
                    <button>Detail</button>
                </div>
            ))};
        </>
    )
}
export default Task;
